import React, { useState } from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomePage from './pages/HomePage';
import CMSLogin from './pages/CMSLogin';
import CMSDashboard from './pages/CMSDashboard';
import CMSLocationManagement from './pages/CMSLocationManagement';

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  return (
    <Router>
      <div className="app">
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route 
            path="/cms/login" 
            element={<CMSLogin onLogin={setIsLoggedIn} />} 
          />
          <Route 
            path="/cms/dashboard" 
            element={isLoggedIn ? <CMSDashboard /> : <CMSLogin onLogin={setIsLoggedIn} />} 
          />
          <Route 
            path="/cms/locations" 
            element={isLoggedIn ? <CMSLocationManagement /> : <CMSLogin onLogin={setIsLoggedIn} />} 
          />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
